import './App.css'
import Video from "./components/video";



function App(){
  return (
    <div className="App">
      <div>Videos</div>
      <Video title="First title" views="100k" time="1 Year ago" channel='Nishant'></Video>
      <Video title="second title" views="10k" time="1 Month ago" channel='Bhalothia'></Video>
      <Video title="Third title" views="1M" time="1 Month ago" channel='third Channel'></Video>
    </div>
  )
}



export default App;



